import React from 'react'
import { Routes, Route } from 'react-router-dom'
import { Appbar } from '../MenuBar/Appbar'

export const Routerpaths = () => {
    return (
        <div>
            <Routes>
                <Route element={<Appbar />} path='/home' />
            </Routes>
        </div>
    )
}
